function: "This is a little tool we use at the shop to defeat the interlocks on our SLA machines while we are doing all-too-frequent maintenance on the laser and mirrors. Yes, we use goggles - we're not that stupid!\r\n\r\nThis model is actually my first attempt at CAD. I decided to try OpenSCAD rather than a more traditional tool because I'm much better at coding than I am at drawing! The part is based on measurements I took of an existing part. We only had one, and it seemed like it'd be a good idea to make a few more..."
